import '../css/App.css';
import '../css/Ball.css';

export default function Home() {
  return (
    <div class="container">
      <div class="MenuAngle"></div>
      <div class="oui">
      <section class="stage">
        <figure class="ball bubble"><p class="titre-bulle">Click me</p></figure>
      </section>
      </div>
    </div>
  );
}
